import React, { Component } from 'react'

export default class GridElement extends Component {
	render() {
		return (
			<article class="style0">
				<span class="image">
					<img src="content/images/portfolio/chromatone.png" alt=""></img>
				</span>
					<a target="_blank" href="https://youtu.be/-SmzZ0YtzQc">
						<div class="spacing"></div>
						<h2 class="content">Chromatone</h2>
						<div class="content">
							<p>A VR experience that allows interaction with individual instruments through modulation and particle visualizations.</p>
						</div>
					</a>
			</article>
		)
	}
}
